// Get the raw body object from the input.
const rawBody = $input.item.json.body || $input.first().json;
let inputData = {};

// 1. Determine the structure and get the core data object (inputData)
if (Array.isArray(rawBody) && rawBody.length > 0) {
    // SCENARIO 1: New Format (an array of objects). Use the first item.
    inputData = rawBody[0];
} else if (typeof rawBody === 'object' && rawBody !== null) {
    // SCENARIO 2: Previous Format (a single object). Use the body directly.
    inputData = rawBody;
}

// 2. Retrieve inputs using fallback logic (New Key || Old Key)
// This ensures the script is backward-compatible.
const jobTitlesInput = inputData["Job Title"] || inputData.jobtitle || '';
const locationInput = inputData.Location || inputData.location || '';
const keywordsInput = inputData.Industry || inputData.keywords || '';
const employeeHeadcountsInput = inputData["Company employee count"] || inputData.employee_headcounts || '';

// The base URL for the Apollo people search
const baseUrl = 'https://app.apollo.io/#/people?';
const params = [];

// 3. Campaign Logic (Unchanged from Revised Script)

// 3.1. Add page parameter first (for consistent ordering)
params.push('page=1');

// 3.2. Handle Job Titles (personTitles[])
if (jobTitlesInput && jobTitlesInput.trim().length > 0) {
    const titles = jobTitlesInput
        .split(',')
        .map(title => title.trim())
        .filter(title => title.length > 0);

    titles.forEach(title => {
        params.push(`personTitles[]=${encodeURIComponent(title)}`);
    });
}

// 3.3. Handle Employee Headcounts (organizationNumEmployeesRanges[])
if (employeeHeadcountsInput && employeeHeadcountsInput.toString().trim().length > 0) {
    let headcount = employeeHeadcountsInput.toString().trim();

    // CONVERSION: Standardize "1-10" format to Apollo's "1,10" format
    headcount = headcount.replace('-', ',');
    params.push(`organizationNumEmployeesRanges[]=${headcount.replace(',', '%2C')}`);
}

// 3.4. Handle Keywords/Industry (qKeywords)
if (keywordsInput && keywordsInput.trim().length > 0) {
    params.push(`qKeywords=${encodeURIComponent(keywordsInput.trim())}`);
}

// 3.5. Add static sorting parameters
params.push('sortAscending=false');
params.push('sortByField=%5Bnone%5D');

// 3.6. Handle Location (personLocations[])
if (locationInput && locationInput.trim().length > 0) {
    const location = locationInput.trim().replace(', ', '%2C%20');
    params.push(`personLocations[]=${location.replace(' ', '%20')}`);
}

// 4. Combine and Return
const finalUrl = baseUrl + params.join('&');

return {
    generatedUrl: finalUrl,
    debug: {
        jobTitlesReceived: jobTitlesInput,
        locationReceived: locationInput,
        keywordsReceived: keywordsInput,
        employeeHeadcountsReceived: employeeHeadcountsInput
    }
};

