const leadData = $('Mark as Processing').first().json;
const linkedinProfile = $('PhantomBuster - LinkedIn Profile').first().json;
const companyProfile = $('PhantomBuster - Company Profile').first().json;
const websiteData = $('Scrape Website').first().json;

// Clean HTML from website
const cleanHtml = (html) => {
  if (!html) return '';
  return html
    .replace(/<script[\s\S]*?>[\s\S]*?<\/script>/gi, '')
    .replace(/<style[\s\S]*?>[\s\S]*?<\/style>/gi, '')
    .replace(/<\/?[^>]+(>|$)/g, '')
    .replace(/&nbsp;/gi, ' ')
    .replace(/\s+/g, ' ')
    .trim()
    .substring(0, 5000);
};

const websiteText = cleanHtml(websiteData?.data || '');

// Extract key information
const enrichedData = {
  lead: leadData,
  linkedin: {
    personal: linkedinProfile?.output || {},
    company: companyProfile?.output || {}
  },
  website: websiteText,
  timestamp: new Date().toISOString()
};

return enrichedData;

// Get all the items passed from the previous node
const items = $input.all();

// Loop through each item in the input array
for (const item of items) {
  // Get the LinkedIn URL from the current item's JSON data
  const linkedInUrl = item.json['LinkedIn URL'];

  // Main Logic - Fix HTTP to HTTPS
  if (linkedInUrl && typeof linkedInUrl === 'string' && linkedInUrl.startsWith('http://')) {
    item.json['LinkedIn URL'] = linkedInUrl.replace('http://', 'https://');
  }
}

// Return the entire array of modified items
return items;

/**
 * URL normalization function.
 */
function normalizeUrl(inputUrl) {
  if (!inputUrl || typeof inputUrl !== 'string') {
    return null;
  }

  let url = inputUrl.trim();

  // Ensure it starts with a protocol, defaulting to https.
  if (!url.startsWith('http://') && !url.startsWith('https://')) {
    url = 'https://' + url;
  }

  // Replace http:// with https://
  url = url.replace(/^http:\/\//i, 'https://');

  // Remove 'www.' that follows the protocol
  url = url.replace(/^https:\/\/www\./i, 'https://');

  return url;
}

// Main Logic
for (const item of items) {
  const originalUrl = item.json.website;
  if (originalUrl) {
    item.json.website = normalizeUrl(originalUrl);
  }
}

// Return all the modified items.
return items;

